        void justinTVGuideToolStripMenuItem_Click(object sender, System.EventArgs e)
        {
            SCTVJustinTV.JustinTVGuide justinTV = new SCTVJustinTV.JustinTVGuide();

            if (justinTV.ShowDialog() == System.Windows.Forms.DialogResult.OK && justinTV.SelectedUrl.Trim().Length > 0)
            {
                //display media
                displayBrowser();

                string url = justinTV.SelectedUrl.Trim();

                if (!url.ToLower().StartsWith("http://"))
                    url = "http://" + url;

                safeSurf.URL = new System.Uri(url);
            }
        }

